import tw from "twin.macro"

export default function App() {
  return (
    <>
      <WidthAndHeight />
    </>
  )
}

const HTML = () => {
  return (
    <>
      <h1>Hello</h1>
      <p>World</p>
    </>
  )
}

const WidthAndHeight = () => {
  return (
    <FullScreenWrapper>
      <Box1 />
      <Box2 />
      <Box3 />
      <Box4 />
    </FullScreenWrapper>
  )
}
const FullScreenWrapper = tw.div`w-screen h-screen`
const Box1 = tw.div`w-1/2 h-1/2 bg-green-500`
const Box2 = tw.div`w-1/3 h-1/3 bg-yellow-500`
const Box3 = tw.div`w-44 h-44 bg-blue-500`
const Box4 = tw.div`w-32 h-32 bg-red-500`

const Colors = () => {
  return <>Colors</>
}

const Margin = () => {
  return <>Margin</>
}

const Padding = () => {
  return <>Padding</>
}

const Flex = () => {
  return <>Flex</>
}

const Grid = () => {
  return <>Grid</>
}
